import React from "react";
import prof from '../Images/prof.png';
import { Link,useLocation,useNavigate } from "react-router-dom";



const Details = (props) => {
    console.log(props);
    const location = useLocation();

    console.log(location.state.name);

    return(
        <div className="main" >
          <br/>
          <br/>
          <br/>
          <br/>
          <div align="right">
          <Link to='/'>
          <h3>Go Back</h3></Link></div>
          <h1>Personal Details</h1>
        <div className="ui card centered">
        <div className="image" >
            <img src={prof} alt="user"/>
            <div className="content">
            <div className="header"><h2>{location.state.name}</h2></div>
            <div className="description"><p>{location.state.email}</p></div>
            <div className="description"><p>{location.state.location}</p></div>
        </div>
        </div>
        </div>


        </div>
    );
}


export default Details;
